vector<int> rolling_max(vector<int> numbers) {
    vector<int> result;
    int running_max = numbers.empty() ? 0 : numbers[0]; // Initialize running_max with the first element or 0 if empty

    for (int n : numbers) {
        running_max = max(running_max, n); // Update running_max
        result.push_back(running_max); // Append the current running_max to the result
    }

    return result; // Return the vector of rolling maximums
}

