using namespace std;

vector<int> parse_nested_parens(string paren_string) {
    vector<int> result;

    auto parse_paren_group = [](const string& s) {
        int depth = 0;
        int max_depth = 0;
        for (char c : s) {
            if (c == '(') {
                depth++;
                max_depth = max(depth, max_depth);
            } else if (c == ')') {
                depth--;
            }
        }
        return max_depth;
    };

    stringstream ss(paren_string);
    string group;
    while (ss >> group) {
        if (!group.empty()) {
            result.push_back(parse_paren_group(group));
        }
    }

    return result;
}

