int how_many_times(string str, string substring) {
    int times = 0;
    int str_length = str.length();
    int sub_length = substring.length();

    for (int i = 0; i <= str_length - sub_length; i++) {
        if (str.substr(i, sub_length) == substring) {
            times++;
        }
    }

    return times;
}

