vector<int> parse_music(string music_string) { 
    unordered_map<string, int> note_map = {
        {"o", 4},
        {"o|", 2},
        {".|", 1}
    };

    vector<int> beats;
    stringstream ss(music_string);
    string note;

    while (ss >> note) {
        if (note_map.find(note) != note_map.end()) {
            beats.push_back(note_map[note]);
        }
    }

    return beats;
}

