vector<int> factorize(int n) {
    vector<int> fact;
    for (int i = 2; i <= sqrt(n);) {
        if (n % i == 0) {
            fact.push_back(i);
            n /= i;
        } else {
            i++;
        }
    }
    if (n > 1) {
        fact.push_back(n);
    }
    return fact;
}

