vector<int> remove_duplicates(vector<int> numbers) {
    unordered_map<int, int> count_map;
    // Count occurrences of each number
    for (int n : numbers) {
        count_map[n]++;
    }

    vector<int> result;
    // Collect numbers that occur only once
    for (int n : numbers) {
        if (count_map[n] == 1) {
            result.push_back(n);
        }
    }

    return result;
}

