vector<int> sort_third(vector<int> l) {
    vector<int> third_elements;

    // Collect elements at indices divisible by 3
    for (int i = 0; i < l.size(); i += 3) {
        third_elements.push_back(l[i]);
    }

    // Sort the collected elements
    sort(third_elements.begin(), third_elements.end());

    // Place sorted elements back into their original positions
    for (int i = 0, j = 0; i < l.size(); i += 3, j++) {
        l[i] = third_elements[j];
    }

    return l;
}

