bool is_prime(int p) {
    if (p < 2) return false;
    for (int k = 2; k <= sqrt(p); k++) {
        if (p % k == 0) return false;
    }
    return true;
}

int prime_fib(int n) {
    int f1 = 0, f2 = 1, fn = 0;
    int prime_count = 0;

    while (true) {
        fn = f1 + f2; // Generate the next Fibonacci number
        f1 = f2;      // Update f1 to the previous f2
        f2 = fn;      // Update f2 to the current Fibonacci number

        if (is_prime(fn)) {
            prime_count++;
            if (prime_count == n) {
                return fn; // Return the n-th prime Fibonacci number
            }
        }
    }
}

