vector<float> sort_even(vector<float> l) {
    vector<float> evens, odds, ans;

    // Extract even and odd indexed elements
    for (size_t i = 0; i < l.size(); i++) {
        if (i % 2 == 0) {
            evens.push_back(l[i]);
        } else {
            odds.push_back(l[i]);
        }
    }

    // Sort the even indexed elements
    sort(evens.begin(), evens.end());

    // Construct the result vector
    size_t even_size = evens.size();
    size_t odd_size = odds.size();
    for (size_t i = 0; i < odd_size; i++) {
        ans.push_back(evens[i]);
        ans.push_back(odds[i]);
    }

    // If there is an extra even indexed element, add it to the result
    if (even_size > odd_size) {
        ans.push_back(evens[even_size - 1]);
    }

    return ans;
}

