int fib4(int n) {
    int results[4] = {0, 0, 2, 0}; // Initialize the first four values
    if (n < 4) {
        return results[n]; // Return the known values for n < 4
    }

    for (int i = 4; i <= n; ++i) {
        int next_value = results[0] + results[1] + results[2] + results[3]; // Calculate the next value
        // Shift the results to maintain the last four values
        results[0] = results[1];
        results[1] = results[2];
        results[2] = results[3];
        results[3] = next_value; // Update the last value
    }

    return results[3]; // Return the n-th value
}

#undef NDEBUG
#include<assert.h>
