#include <stdio.h>

bool is_prime(int k) {
    if (k < 2) return false;
    for (int i = 2; i * i <= k; i++) {
        if (k % i == 0) return false;
    }
    return true;
}

int largest_prime_factor(int n) {
    int largest = 1;
    for (int j = 2; j <= n; j++) {
        if (n % j == 0 && is_prime(j)) {
            largest = j; // Update largest if j is a prime factor
        }
    }
    return largest;
}

