string circular_shift(int x, int shift) {
    string s = to_string(x);
    int len = s.length();

    if (shift > len) {
        return string(s.rbegin(), s.rend()); // Return reversed string
    } else {
        return s.substr(len - shift) + s.substr(0, len - shift); // Circular shift
    }
}

