int fibfib(int n) {
    if (n == 0) return 0;
    if (n == 1) return 0;
    if (n == 2) return 1;

    int a = 0, b = 0, c = 1; // fibfib(0), fibfib(1), fibfib(2)
    int result = 0;

    for (int i = 3; i <= n; i++) {
        result = a + b + c; // fibfib(n) = fibfib(n-1) + fibfib(n-2) + fibfib(n-3)
        a = b; // Update for next iteration
        b = c; // Update for next iteration
        c = result; // Update for next iteration
    }

    return result;
}

