vector<int> pluck(vector<int> arr) {
    if (arr.empty()) return {};

    int smallest_even = INT_MAX;
    int index = -1;

    for (int i = 0; i < arr.size(); i++) {
        if (arr[i] % 2 == 0) { // Check if the number is even
            if (arr[i] < smallest_even) { // Check if it's the smallest even number
                smallest_even = arr[i];
                index = i; // Update the index of the smallest even number
            }
        }
    }

    if (index == -1) return {}; // No even numbers found
    return {smallest_even, index}; // Return the smallest even number and its index
}

