vector<int> strange_sort_list(vector<int> lst) {
    vector<int> res;
    bool switchFlag = true; // To alternate between min and max

    while (!lst.empty()) {
        if (switchFlag) {
            // Find and append the minimum value
            auto minIt = min_element(lst.begin(), lst.end());
            res.push_back(*minIt);
            lst.erase(minIt); // Remove the minimum value
        } else {
            // Find and append the maximum value
            auto maxIt = max_element(lst.begin(), lst.end());
            res.push_back(*maxIt);
            lst.erase(maxIt); // Remove the maximum value
        }
        switchFlag = !switchFlag; // Toggle the switch
    }
    return res;
}

