        N /= 10;       // Remove the last digit
    }

    // Convert sum to binary
    string binary = "";
    if (sum == 0) return "0"; // Handle the case where sum is 0
    while (sum > 0) {
        binary = to_string(sum % 2) + binary; // Prepend the binary digit
        sum /= 2; // Divide sum by 2
    }

    return binary;
}

