string encrypt(string s) {
    string d = "abcdefghijklmnopqrstuvwxyz";
    string out = "";

    for (char c : s) {
        if (d.find(c) != string::npos) {
            int newIndex = (d.find(c) + 4) % 26; // Shift down by 4
            out += d[newIndex];
        } else {
            out += c; // Keep the character unchanged if not in the alphabet
        }
    }

    return out;
}

