using namespace std;

int is_bored(string S) {
    int count = 0;
    stringstream ss(S);
    string sentence;

    // Split the string into sentences based on delimiters
    while (getline(ss, sentence, '.')) {
        if (sentence.empty()) continue;
        if (sentence.back() == '?') {
            sentence.pop_back();
            if (sentence.empty()) continue;
        }
        if (sentence.back() == '!') {
            sentence.pop_back();
            if (sentence.empty()) continue;
        }

        // Trim leading spaces
        while (!sentence.empty() && isspace(sentence[0])) {
            sentence.erase(sentence.begin());
        }

        // Check if the sentence starts with "I "
        if (sentence.substr(0, 2) == "I ") {
            count++;
        }
    }

    return count;
}

