int next_smallest(vector<int> lst) {
    set<int> unique_elements(lst.begin(), lst.end()); // Use a set to store unique elements
    if (unique_elements.size() < 2) {
        return -1; // Return -1 to indicate None (as per C++ convention)
    }
    auto it = unique_elements.begin();
    advance(it, 1); // Move iterator to the second smallest element
    return *it; // Return the second smallest element
}

