vector<vector<int>> get_row(vector<vector<int>> lst, int x) {
    vector<vector<int>> coords;

    // Find all occurrences of x and store their coordinates
    for (int i = 0; i < lst.size(); i++) {
        for (int j = 0; j < lst[i].size(); j++) {
            if (lst[i][j] == x) {
                coords.push_back({i, j});
            }
        }
    }

    // Sort coordinates by row (ascending) and then by column (descending)
    sort(coords.begin(), coords.end(), [](const vector<int>& a, const vector<int>& b) {
        if (a[0] == b[0]) {
            return a[1] > b[1]; // Sort by column in descending order if rows are the same
        }
        return a[0] < b[0]; // Sort by row in ascending order
    });

    return coords;
}

