bool isPrime(int n) {
    if (n <= 1) return false; // 0 and 1 are not prime numbers
    for (int i = 2; i <= sqrt(n); i++) {
        if (n % i == 0) {
            return false;
        }
    }
    return true;
}

int skjkasdkd(vector<int> lst) {
    int maxPrime = 0;
    for (int num : lst) {
        if (num > maxPrime && isPrime(num)) {
            maxPrime = num;
        }
    }

    // Calculate the sum of digits of maxPrime
    int sumOfDigits = 0;
    while (maxPrime > 0) {
        sumOfDigits += maxPrime % 10; // Add the last digit
        maxPrime /= 10; // Remove the last digit
    }

    return sumOfDigits;
}

