bool check_dict_case(map<string,string> dict) {
    if (dict.empty()) {
        return false; // Return false if the map is empty
    }

    string state = "start";
    for (const auto& pair : dict) {
        const string& key = pair.first;

        // Check if the key is not a string (not applicable in this case since keys are always strings)
        if (state == "start") {
            if (isupper(key[0])) {
                state = "upper";
            } else if (islower(key[0])) {
                state = "lower";
            } else {
                return false; // If the key is neither upper nor lower case
            }
        } else {
            // Check if the key matches the established case
            if ((state == "upper" && !isupper(key[0])) || (state == "lower" && !islower(key[0]))) {
                return false; // Return false if the case does not match
            }
        }
    }
    return true; // Return true if all keys are in the same case
}

#undef NDEBUG
