int closest_integer(string value) {
    // Remove trailing zeros if the number is a decimal
    if (value.find('.') != string::npos) {
        value.erase(value.find_last_not_of('0') + 1, string::npos);
        if (value.back() == '.') {
            value.pop_back(); // Remove the decimal point if it's the last character
        }
    }

    double num = stod(value); // Convert string to double
    int res;

    // Check if the number is equidistant from two integers
    if (value.size() > 1 && value[value.size() - 2] == '5') {
        if (num > 0) {
            res = ceil(num); // Round up for positive numbers
        } else {
            res = floor(num); // Round down for negative numbers
        }
    } else {
        res = static_cast<int>(round(num)); // Round normally
    }

    return res;
}

