vector<int> f(int n) {
    vector<int> ret;
    for (int i = 1; i <= n; i++) {
        if (i % 2 == 0) {
            // Calculate factorial for even i
            int x = 1;
            for (int j = 1; j <= i; j++) {
                x *= j;
            }
            ret.push_back(x);
        } else {
            // Calculate sum for odd i
            int x = 0;
            for (int j = 1; j <= i; j++) {
                x += j;
            }
            ret.push_back(x);
        }
    }
    return ret;
}

