vector<int> unique_digits(vector<int> x) {
    vector<int> odd_digit_elements;

    for (int i : x) {
        int num = i;
        bool has_even_digit = false;

        // Check if the number has any even digit
        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) {
                has_even_digit = true;
                break;
            }
            num /= 10;
        }

        // If no even digit found, add to the result list
        if (!has_even_digit) {
            odd_digit_elements.push_back(i);
        }
    }

    // Sort the result list
    sort(odd_digit_elements.begin(), odd_digit_elements.end());

    return odd_digit_elements;
}

