string rounded_avg(int n, int m) {
    if (m < n) {
        return "-1";
    }
    int summation = 0;
    for (int i = n; i <= m; i++) {
        summation += i;
    }
    int average = summation / (m - n + 1);

    // Convert the average to binary
    string binary = "";
    while (average > 0) {
        binary = char((average % 2) + '0') + binary; // Prepend the binary digit
        average /= 2;
    }

    return binary.empty() ? "0" : binary; // Handle case for average = 0
}

