int digits_sum(int num) {
    int neg = 1;
    if (num < 0) {
        num = -num;
        neg = -1;
    }
    int sum = 0;
    while (num > 0) {
        sum += num % 10;
        num /= 10;
    }
    return sum * neg; // Apply the negative sign to the first digit if necessary
}

int count_nums(vector<int> n) {
    int count = 0;
    for (int num : n) {
        if (digits_sum(num) > 0) {
            count++;
        }
    }
    return count;
}

