bool move_one_ball(vector<int> arr) {
    if (arr.empty()) {
        return true;
    }

    vector<int> sorted_array = arr; // Create a copy of the original array
    sort(sorted_array.begin(), sorted_array.end()); // Sort the array

    int min_value = *min_element(arr.begin(), arr.end()); // Find the minimum value
    int min_index = find(arr.begin(), arr.end(), min_value) - arr.begin(); // Find the index of the minimum value

    // Create the shifted array
    vector<int> my_arr(arr.begin() + min_index, arr.end());
    my_arr.insert(my_arr.end(), arr.begin(), arr.begin() + min_index);

    // Compare the shifted array with the sorted array
    return my_arr == sorted_array;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (move_one_ball({3, 4, 5, 1, 2})==true);
    assert (move_one_ball({3, 5, 10, 1, 2})==true);
    assert (move_one_ball({4, 3, 1, 2})==false);
    assert (move_one_ball({3, 5, 4, 1, 2})==false);
    assert (move_one_ball({})==true);
}

