map<char,int> histogram(string test) {
    map<char, int> countMap;
    stringstream ss(test);
    string letter;
    int maxCount = 0;

    // Count occurrences of each letter
    while (ss >> letter) {
        if (!letter.empty()) {
            countMap[letter[0]]++; // Increment count for the letter
            maxCount = max(maxCount, countMap[letter[0]]); // Update max count
        }
    }

    // Prepare the result map for letters with the maximum count
    map<char, int> resultMap;
    for (const auto& entry : countMap) {
        if (entry.second == maxCount) {
            resultMap[entry.first] = entry.second; // Add to result if count matches max
        }
    }

    return resultMap; // Return the result map
}

