int max_fill(vector<vector<int>> grid, int capacity) {
    int total_lowers = 0;
    for (const auto& row : grid) {
        int water_units = 0;
        for (int water : row) {
            water_units += water; // Count total units of water in the row
        }
        total_lowers += ceil(static_cast<double>(water_units) / capacity); // Calculate lowers needed for this row
    }
    return total_lowers; // Return total lowers needed for all wells
}

