long long minSubArraySum(vector<long long> nums) {
    long long max_sum = 0;
    long long s = 0;

    for (long long num : nums) {
        s += -num; // Accumulate the negative of the current number
        if (s < 0) {
            s = 0; // Reset if the accumulated sum is negative
        }
        max_sum = max(s, max_sum); // Update the maximum sum of negative values
    }

    if (max_sum == 0) {
        max_sum = *max_element(nums.begin(), nums.end()); // Handle all negative numbers
    }

    long long min_sum = -max_sum; // The minimum sum of any non-empty sub-array
    return min_sum;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (minSubArraySum({2, 3, 4, 1, 2, 4}) == 1);
    assert (minSubArraySum({-1, -2, -3}) == -6);
    assert (minSubArraySum({-1, -2, -3, 2, -10}) == -14);
    assert (minSubArraySum({-9999999999999999}) == -9999999999999999);
    assert (minSubArraySum({0, 10, 20, 1000000}) == 0);
    assert (minSubArraySum({-1, -2, -3, 10, -5}) == -6);
