vector<string> select_words(string s, int n) {
    vector<string> result;
    // Split the string into words
    size_t pos = 0;
    string delimiter = " ";
    while ((pos = s.find(delimiter)) != string::npos) {
        string word = s.substr(0, pos);
        s.erase(0, pos + delimiter.length());

        int n_consonants = 0;
        // Count consonants in the word
        for (char c : word) {
            if (tolower(c) != 'a' && tolower(c) != 'e' && tolower(c) != 'i' && 
                tolower(c) != 'o' && tolower(c) != 'u') {
                n_consonants++;
            }
        }
        // Check if the number of consonants matches n
        if (n_consonants == n) {
            result.push_back(word);
        }
    }
    // Check the last word after the final space
    if (!s.empty()) {
        int n_consonants = 0;
        for (char c : s) {
            if (tolower(c) != 'a' && tolower(c) != 'e' && tolower(c) != 'i' && 
                tolower(c) != 'o' && tolower(c) != 'u') {
                n_consonants++;
            }
        }
        if (n_consonants == n) {
            result.push_back(s);
        }
    }
    return result;
}

