int prod_signs(vector<int> arr) {
    if (arr.empty()) return -32768; // Return -32768 for empty array

    int prod = 1; // Initialize product of signs
    int sum_magnitudes = 0; // Initialize sum of magnitudes

    for (int num : arr) {
        if (num == 0) {
            return 0; // If any number is zero, return 0
        }
        if (num < 0) {
            prod *= -1; // Flip the sign for negative numbers
        }
        sum_magnitudes += abs(num); // Add the absolute value to the sum
    }

    return prod * sum_magnitudes; // Return the product of signs multiplied by the sum of magnitudes
}

