vector<string> split_words(string txt) {
    // Check for whitespace
    if (txt.find(' ') != string::npos) {
        vector<string> words;
        size_t pos = 0;
        while ((pos = txt.find(' ')) != string::npos) {
            words.push_back(txt.substr(0, pos));
            txt.erase(0, pos + 1);
        }
        words.push_back(txt); // Add the last word
        return words;
    }
    // Check for commas
    else if (txt.find(',') != string::npos) {
        replace(txt.begin(), txt.end(), ',', ' '); // Replace commas with spaces
        vector<string> words;
        size_t pos = 0;
        while ((pos = txt.find(' ')) != string::npos) {
            words.push_back(txt.substr(0, pos));
            txt.erase(0, pos + 1);
        }
        words.push_back(txt); // Add the last word
        return words;
    }
    // Count lowercase letters with odd order
    else {
        int count = 0;
        for (char c : txt) {
            if (islower(c) && (c - 'a') % 2 == 0) {
                count++;
