int digits(int n) {
    int product = 1;
    int odd_count = 0;
    string str_n = to_string(n); // Convert integer to string

    for (char digit : str_n) {
        int int_digit = digit - '0'; // Convert character to integer
        if (int_digit % 2 == 1) { // Check if the digit is odd
            product *= int_digit; // Multiply to product
            odd_count++; // Increment odd count
        }
    }

    if (odd_count == 0) {
        return 0; // Return 0 if no odd digits
    } else {
        return product; // Return the product of odd digits
    }
}

