using namespace std;

vector<int> minPath(vector<vector<int>> grid, int k) {
    int n = grid.size();
    vector<int> result;
    vector<int> directions = {-1, 0, 1, 0, -1}; // Up, Right, Down, Left
    priority_queue<pair<vector<int>, pair<int, int>>, vector<pair<vector<int>, pair<int, int>>>, 
                   greater<pair<vector<int>, pair<int, int>>>> pq;

    // Start from all cells in the grid
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            pq.push({{grid[i][j]}, {i, j}});
        }
    }

    while (!pq.empty()) {
        auto current = pq.top();
        pq.pop();
        vector<int> path = current.first;
        int x = current.second.first;
        int y = current.second.second;

        // If the path length is k, return it
        if (path.size() == k) {
            return path;
        }

        // Explore neighbors
        for (int d = 0; d < 4; d++) {
            int nx = x + directions[d];
            int ny = y + directions[d + 1];

            // Check if the neighbor is within bounds
            if (nx >= 0 && nx < n && ny >= 0 && ny < n) {
                vector<int> newPath = path;
                newPath.push_back(grid[nx][ny]);
                pq.push({newPath, {nx, ny}});
            }
        }
    }

    return result; // This should never be reached as the answer is guaranteed to exist
}

