boost::any compare_one(boost::any a, boost::any b) {
    stringstream ss_a, ss_b;
    float float_a, float_b;

    // Convert a to string and replace ',' with '.'
    if (a.type() == typeid(string)) {
        string str_a = boost::any_cast<string>(a);
        replace(str_a.begin(), str_a.end(), ',', '.');
        ss_a << str_a;
        ss_a >> float_a;
    } else {
        float_a = boost::any_cast<float>(a);
    }

    // Convert b to string and replace ',' with '.'
    if (b.type() == typeid(string)) {
        string str_b = boost::any_cast<string>(b);
        replace(str_b.begin(), str_b.end(), ',', '.');
        ss_b << str_b;
        ss_b >> float_b;
    } else {
        float_b = boost::any_cast<float>(b);
    }

    // Check for equality
    if (float_a == float_b) {
        return boost::any(); // Return None
    }

    // Return the larger value in its original type
    return (float_a > float_b) ? a : b;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (boost::any_cast<int>(compare_one(1, 2)) == 2);
    assert (boost::any_cast<double>(compare_one(1, 2.5))== 2.5);
    assert (boost::any_cast<int>(compare_one(2, 3)) == 3);
    assert (boost::any_cast<int>(compare_one(5, 6)) == 6);
    assert (boost::any_cast<string>(compare_one(1, string("2,3")))== "2,3");
    assert (boost::any_cast<string>(compare_one(string("5,1"), string("6"))) == "6");
    assert (boost::any_cast<string>(compare_one(string("1"), string("2"))) == "2");
