string fix_spaces(string text) {
    string new_text = "";
    int start = 0, end = 0;
    int n = text.length();

    for (int i = 0; i < n; i++) {
        if (text[i] == ' ') {
            end++;
        } else {
            if (end - start > 2) {
                new_text += "-" + string(1, text[i]);
            } else if (end - start > 0) {
                new_text += string(end - start, '_') + text[i];
            } else {
                new_text += text[i];
            }
            start = i + 1;
            end = start;
        }
    }

    if (end - start > 2) {
        new_text += "-";
    } else if (end - start > 0) {
        new_text += string(end - start, '_');
    }

    return new_text;
}

