            total_sum += lst[i] * lst[i] * lst[i]; // Cube the element if index is a multiple of 4 and not a multiple of 3
        } else {
            total_sum += lst[i]; // Keep the original element if index is neither
        }
    }
    return total_sum; // Return the total sum
}

