string file_name_check(string file_name) {
    vector<string> valid_extensions = {"txt", "exe", "dll"};
    size_t dot_position = file_name.find('.');

    // Check if there is exactly one dot
    if (dot_position == string::npos || file_name.find('.', dot_position + 1) != string::npos) {
        return "No";
    }

    // Split into name and extension
    string name = file_name.substr(0, dot_position);
    string extension = file_name.substr(dot_position + 1);

    // Check if the extension is valid
    if (find(valid_extensions.begin(), valid_extensions.end(), extension) == valid_extensions.end()) {
        return "No";
    }

    // Check if the name is not empty and starts with a letter
    if (name.empty() || !isalpha(name[0])) {
        return "No";
    }

    // Count the number of digits in the name
    int digit_count = 0;
    for (char c : name) {
        if (isdigit(c)) {
            digit_count++;
        }
    }

    // Check if there are more than three digits
    if (digit_count > 3) {
        return "No";
    }

    return "Yes";
}

