bool isPrime(int n) {
    if (n <= 1) return false;
    if (n == 2) return true;
    for (int i = 2; i * i <= n; i++) {
        if (n % i == 0) return false;
    }
    return true;
}

string words_in_sentence(string sentence) {
    stringstream ss(sentence);
    string word;
    vector<string> new_lst;

    while (ss >> word) {
        if (isPrime(word.length())) {
            new_lst.push_back(word);
        }
    }

    string result;
    for (size_t i = 0; i < new_lst.size(); i++) {
        result += new_lst[i];
        if (i < new_lst.size() - 1) {
            result += " ";
        }
    }

    return result;
}

