bool simplify(string x, string n) {
    int a, b, c, d;
    char slash; // To handle the '/' character in the stringstream

    // Parse the first fraction x
    stringstream ss1(x);
    ss1 >> a >> slash >> b;

    // Parse the second fraction n
    stringstream ss2(n);
    ss2 >> c >> slash >> d;

    // Calculate the numerator and denominator of the product
    int numerator = a * c;
    int denom = b * d;

    // Check if the result is a whole number
    return (numerator % denom == 0);
}

