int get_max_triples(int n) {
    vector<int> A(n);
    for (int i = 1; i <= n; i++) {
        A[i - 1] = i * i - i + 1; // Fill the vector A with the given formula
    }

    int count = 0; // To count the number of valid triples
    for (int i = 0; i < n; i++) {
        for (int j = i + 1; j < n; j++) {
            for (int k = j + 1; k < n; k++) {
                if ((A[i] + A[j] + A[k]) % 3 == 0) {
                    count++; // Increment count if the sum is a multiple of 3
                }
            }
        }
    }

    return count; // Return the total count of valid triples
}

