vector<string> bf(string planet1, string planet2) {
    vector<string> planet_names = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};
    vector<string> result;

    // Check if the input planets are valid
    auto it1 = find(planet_names.begin(), planet_names.end(), planet1);
    auto it2 = find(planet_names.begin(), planet_names.end(), planet2);

    if (it1 == planet_names.end() || it2 == planet_names.end() || planet1 == planet2) {
        return result; // Return empty vector if invalid
    }

    int planet1_index = distance(planet_names.begin(), it1);
    int planet2_index = distance(planet_names.begin(), it2);

    // Extract planets in between
    if (planet1_index < planet2_index) {
        for (int i = planet1_index + 1; i < planet2_index; ++i) {
            result.push_back(planet_names[i]);
        }
    } else {
        for (int i = planet2_index + 1; i < planet1_index; ++i) {
            result.push_back(planet_names[i]);
        }
    }

    return result;
}

