string Strongest_Extension(string class_name, vector<string> extensions) {
    string strongest = extensions[0];
    int max_strength = 0;

    // Calculate the strength of the first extension
    int cap = 0, sm = 0;
    for (char c : strongest) {
        if (isupper(c)) cap++;
        else if (islower(c)) sm++;
    }
    max_strength = cap - sm;

    // Iterate through the remaining extensions
    for (const string& ext : extensions) {
        cap = 0;
        sm = 0;
        for (char c : ext) {
            if (isupper(c)) cap++;
            else if (islower(c)) sm++;
        }
        int current_strength = cap - sm;

        // Update strongest extension if current strength is greater
        if (current_strength > max_strength) {
            strongest = ext;
            max_strength = current_strength;
        }
    }

    // Construct the result
    return class_name + "." + strongest;
}

