    string num_str = to_string(abs(num)); // Convert to string and handle negative numbers

    for (char digit : num_str) {
        int digit_value = digit - '0'; // Convert char to int
        if (digit_value % 2 == 0) {
            even_count++;
        } else {
            odd_count++;
        }
    }

    return {even_count, odd_count}; // Return the counts in a vector
}

