string int_to_mini_roman(int number) {
    vector<int> num = {1, 4, 5, 9, 10, 40, 50, 90,  
                       100, 400, 500, 900, 1000}; 
    vector<string> sym = {"i", "iv", "v", "ix", "x", "xl",  
                          "l", "xc", "c", "cd", "d", "cm", "m"}; 
    int i = 12;
    string res = "";

    while (number) {
        int div = number / num[i];
        number %= num[i];
        while (div) {
            res += sym[i];
            div -= 1;
        }
        i -= 1;
    }

    return res;
}

