string find_max(vector<string> words) {
    return *max_element(words.begin(), words.end(), [](const string& a, const string& b) {
        int unique_a = set<char>(a.begin(), a.end()).size();
        int unique_b = set<char>(b.begin(), b.end()).size();
        if (unique_a == unique_b) {
            return a > b; // Sort lexicographically
        }
        return unique_a < unique_b; // Sort by number of unique characters
    });
}

