    for (char &c : s) {
        if (isalpha(c)) {
            c = islower(c) ? toupper(c) : tolower(c);
            hasLetter = true;
        }
    }
    if (!hasLetter) {
        return string(s.rbegin(), s.rend());
    }
    return s;
}

