#include <stdexcept>

using namespace std;

int do_algebra(vector<string> operato, vector<int> operand) {
    if (operand.size() < 2 || operato.size() != operand.size() - 1) {
        throw invalid_argument("Invalid input sizes.");
    }

    int result = operand[0];

    for (size_t i = 0; i < operato.size(); ++i) {
        int next_operand = operand[i + 1];
        if (operato[i] == "+") {
            result += next_operand;
        } else if (operato[i] == "-") {
            result -= next_operand;
        } else if (operato[i] == "*") {
            result *= next_operand;
        } else if (operato[i] == "//") {
            if (next_operand == 0) {
                throw invalid_argument("Division by zero.");
            }
            result /= next_operand;
        } else if (operato[i] == "**") {
            result = pow(result, next_operand);
        } else {
            throw invalid_argument("Invalid operator.");
        }
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (do_algebra({"**", "*", "+"}, {2, 3, 4, 5}) == 37);
    assert (do_algebra({"+", "*", "-"}, {2, 3, 4, 5}) == 9);
    assert (do_algebra({"//", "*"}, {7, 3, 4}) == 8);
}

