string string_to_md5(string text) {
    if (text.empty()) {
        return ""; // Return empty string to represent None in Python
    }

    unsigned char digest[MD5_DIGEST_LENGTH];
    MD5((unsigned char*)text.c_str(), text.size(), digest);

    char md5String[33];
    for (int i = 0; i < 16; i++) {
        snprintf(&md5String[i * 2], 3, "%02x", (unsigned int)digest[i]);
    }

    return string(md5String);
}

